export var Router=class Router{constructor(root,onnavigation=null){this.root=root;this.onnavigation=onnavigation;window.addEventListener("popstate",this.listener.bind(this))}listener(event){return this.onnavigation(document.location.pathname)}navigate(route){var state,title;state={};title="";history.pushState(state,title,route);return this.onnavigation(route)}};